import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import iconLogo from './iconLogo.png';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <div>
    <div>
      <a href="/">
        판다마켓
        <img
          className="icon-logo"
          src={iconLogo}
        />
        {/* <img class="text-logo" src="" alt="Text-logo" /> */}
      </a>
    </div>
    <div>
      <div>
        <a href="">
          자유게시판
        </a>
      </div>
      <div>
        <a href="">
          중고마켓
        </a>
      </div>
    </div>
    <div class="button-box">
      <a href="">
        <button class="">로그인</button>
      </a>
    </div>
  </div>
);

reportWebVitals();
